import '../App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import MainNavbar from '../components/MainNavbar';
import Buscador from '../components/Buscador';
import Upload from '../components/upload';



function Home() {
  return (
    <div className="App">
      <MainNavbar/>
      <Buscador/>
      <Upload/>
    </div>
  );
}

export default Home;
